         y="15.996"
         id="tspan122">Ordene findes i rammen nederst på siden. </tspan><tspan
         x="0 8.7600002 13.764 18.167999 21.204 26.2092 30.613199 33.6492 37.1544 42.158401 52.046398 55.082401 61.251598 65.511597 71.847603 74.370003 77.405998 83.707199 90.187202 93.223198 96.415199 102.2952 107.9604 113.0004 116.0364 120.2964 126.1764 131.4084 134.4324 137.4684 143.6136 148.0992 154.57919 160.02721 165.0672"

         id="tspan124">Der er fem ord, du ikke skal bruge.</tspan><tspan

       id="text172"><tspan
         x="0 5.7119999 11.916 16.176001 21.1812 27.7332 30.769199 39.743999 42.768002 47.028 52.033199 58.585201 61.621201 66.625198 72.034798 77.914803 80.938797 85.944 90.348 93.384003 97.126801 100.3188 103.3428 106.3788 112.6068 118.0788 121.1148 124.6548 129.1524 134.3844 137.42039 142.6524 147.1992 153.414 158.59801 161.658 167.95799 172.998 176.034 182.1312 187.42439 192.4296 196.8336 199.8696 206.2056 211.43761 217.0536 219.576 222.612 231.6252 236.85719 243.40919 246.44521 251.4492 256.85999 262.73999 265.76401 270.76801 275.172 278.20801 284.436 289.9776 294.23761 299.4696 302.50562 312.39359 317.48041 322.92841 328.00439 331.7124 334.74841 337.9404 340.97641 345.23639 348.42841 354.98041 358.01639 361.5564 366.09241 369.28439 373.02719 376.21921 382.55521 385.07761 388.11359 394.34161 399.8136 402.84961 409.24561 414.4776 421.0296 424.06561 430.46161 435.6936 440.0976"
         y="0"
         id="tspan140">Søren Olsen cykler til og fra arbejde hver dag. Han cykler også meget i sin fritid, og han har </tspan><tspan
         x="0 6 12 18 24 30 36 42 48 54 60 66 72 78 84 90 96 99.036003 104.916 111.12 117.3228 121.0308 124.0668 129.07201 135.62399 138.66 144.936 150.3 153.336 158.34 163.75079 169.41721 174.48 177.504 180.0264 183.06239 187.3224 193.49159 203.37959 206.4156 212.8116 218.04359 224.5956 227.63161 232.6356 237.0396 240.07561 244.6116 247.8036 253.2756 257.0184 260.21039 265.6824 268.71841 274.35721 277.3812 282.63721 288.97321 292.00919 295.5144 301.68359 305.41681"
         y="27"
         id="tspan142">________________ købt en ny cykel, som han er rigtig glad for.</tspan><tspan
         x="0 6.6479998 13.2 16.236 22.572001 27.804001 33.276001 36.312 40.571999 46.452 51.683998 54.708 57.743999 63.456001 69.660004 73.921204 78.925201 85.477203 88.513199 94.849197 100.0812 103.1172 109.2624 112.4544 118.6104 121.6344 124.8264 131.0304 134.6328 139.67281 145.3392 150.414 154.12199 156.64439 159.6804 165.9072 171.3792 174.41521 180.8112 186.0432 192.5952 195.6312 199.3392 204.5712 210.0192 215.0244 219.42841 222.4644 226.7244 231.78841 234.69479 240.1788 243.7188 249.92281 252.94679 258.39481 263.4588 266.48279 269.6748 275.14679 278.1828 283.1868 288.5976 294.4776 297.50159 302.50681 309.05881 312.09479 318.39481 323.39999 327.87479 334.27081 339.27481 345.82681 348.34921 351.38519 360.39841 365.6304 372.1824 375.21841 381.55441 386.78641 391.2612 396.92639 401.93161 406.19159 411.19681 415.6008 418.63681 424.93799 429.94199 436.49399 439.53 446.01001 452.31119 457.31641 463.86841 467.37241 473.5416 477.94559 480.9816 487.2084 492.68039 495.7164 501.18839 506.42041 510.8244"
         y="72"
         id="tspan144">En dag skal Søren på biblioteket, og han tager selvfølgelig cyklen derhen. Han parkerer den udenfor og går </tspan><tspan
         x="0 3.1919999 9.7440004 16.08 19.115999 25.452 30.684 33.720001 39.863998 43.056 49.2132 52.237202 55.429199 61.633202 65.235603 70.275597 75.940804 81.0168 84.7248 87.2472 90.283203 95.995201 102.1992 106.4592 111.4644 118.0164 121.0524 125.3124 131.1924 136.42439 139.44839 142.48441 148.6644 153.89639 158.1564 163.1964 166.23241 171.4644 175.00439 178.0284 183.1512 188.4444 193.44839 197.70959 202.7496 205.7856 212.3376 218.56441 224.2032 227.2272 232.2672 235.30321 241.4832 247.68719 253.1364 258.14041 261.8736 264.396 267.43201 271.69199 276.92401 279.95999 286.35599 291.58801 298.14001 301.17599 306.17999 310.58401 313.62 319.9212 324.92639 329.33041 332.36639 338.36639 344.36639 350.36639 356.36639 362.36639 368.36639 374.36639 380.36639 386.36639 392.36639 398.36639 404.36639 410.36639 416.36639 422.36639 428.36639 431.4024 434.59439 437.6304 442.7052 446.41321 449.44919 455.09161 461.2608 465.86639 469.5744 472.61041 478.81439 481.87439 486.93719 493.09439 496.11841 499.31039 505.1904 507.7128"
         y="99"
         id="tspan146">ind på biblioteket. Søren skal bare aflevere nogle bøger, så han er der ________________ i et kort øjeblik. </tspan><tspan
         x="0 8.7480001 13.98 17.016001 23.412001 28.643999 35.195999 38.231998 43.874401 50.0424 59.930401 69.818398 74.823601 79.2276 82.263603 88.743599 95.079597 97.601997 100.638 105.642 110.046 113.082 119.478 124.71 131.26199 135.522 138.558 143.562 148.97279 154.63921 159.702 162.726 165.76199 171.246 179.09399 184.974 187.4964 190.53239 196.2444 202.44839 206.7084 211.71359 218.26559 221.30161 227.4576 230.4816 233.556 238.8504 243.8544 248.25841 251.2944 261.1824 266.2692 271.71719 276.79321 280.50119 283.5372 289.5372 295.5372 301.5372 307.5372 313.5372 319.5372 325.5372 331.5372 337.5372 343.5372 349.5372 355.5372 361.5372 367.5372 373.5372 379.5372 382.0596 385.09561 394.1088 399.34079 405.89279 408.9288 414.80881 420.0408 426.5928 429.62881 433.88879 437.08081 446.96881 453.3624 458.42639 461.45041 465.15839 471.55441 476.55841 483.11041 486.14639 489.33841 495.21841 500.8848 505.9248"
         y="126"
         id="tspan148">Da han kommer ud, er hans cykel væk. Søren bliver meget ________________. Han kan simpelthen ikke </tspan><tspan
         x="0 3.5051999 9.6731997 14.0544 18.3144 22.0224 27.2544 29.7768 32.812801 38.0448 41.7528 44.788799 51.340801 57.568802 63.0168 68.022003 74.573997 77.610001 83.489998 88.722 95.274002 98.309998 101.85 105.042 111.594 117.894 122.934 125.97 132.306 137.53799 140.57401 145.806 149.51401 152.55 156.258 161.49001 166.938 171.978 175.01401 180.246 186.798 193.134 197.394 202.43401 206.694 209.73 213.47279 216.66479 223.2168 228.83279 231.35519"
         y="153"
         id="tspan150">forstå, at nogen kan finde på at tage andres ting. </tspan><tspan
         x="0 5.7119999 11.916 16.176001 21.1812 27.7332 30.769199 35.029202 40.909199 46.141201 49.165199 52.201199 56.461201 61.523998 64.430397 69.914398 73.454399 79.658401 82.682404 88.131599 93.194397 96.218399 99.4104 104.8824 107.9184 114.3144 119.3436 124.638 129.67799 132.714 137.718 144.27 147.306 152.53799 159.09 165.3912 170.3952 176.9472 179.9832 184.9872 190.39799 196.06441 201.1272 204.1512 206.6736 209.70959 219.5976 224.6028 231.1548 234.1908 240.492 245.496 252.048 258.60001 263.64001 266.67599 272.20679 277.43881 283.99081 289.4628 292.49881 298.1604 301.35239 304.3764 307.41241 313.80841 319.04041 325.59241 328.62839 334.62839 340.62839 346.62839 352.62839 358.62839 364.62839 370.62839 376.62839 382.62839 388.62839 394.62839 400.62839 406.62839 412.62839 418.62839 424.62839 427.6644 433.5444 439.74841 445.9632 451.0032 454.03922 459.0444 465.59641 468.63239 475.02841 480.09119 483.1152 486.82321 489.85919 496.13519 500.75879 503.28119"
         y="180"
         id="tspan152">Søren skal selvfølgelig have en anden cykel, men denne gang vil han ________________ købe en helt ny. </tspan><tspan
         x="0 9.0131998 14.2452 20.797199 23.8332 29.496 32.688 35.712002 38.748001 44.627998 50.832001 57.046799 62.0868 65.122803 70.127998 76.68 79.716003 85.860001 90.346802 96.826797 102.2988 106.0068 108.528 111.564 117.564 123.564 129.564 135.564 141.564 147.564 153.564 159.564 165.564 171.564 177.564 183.564 189.564 195.564 201.564 207.564 210.60001 214.464 219.828 225.1212 230.16119 233.1972 238.20239 242.6064 245.6424 252.1944 258.36359 262.84921 272.73721 277.96921 280.99319 284.7012 287.73721 290.9292 296.8092 302.4744 307.5144 310.55042 314.81039 320.04239 323.0784 326.27039 332.82239 336.4248 341.42999 345.69 350.73001 354.98999 359.25 364.25519 368.5152 373.578 379.87921 384.91919 387.9552 391.14719 394.1832 399.41519 403.1232 406.15921 410.41919 414.1272 417.18719 425.03519 428.0592 433.09921 436.13519 441.66599 446.89801 456.78601 459.81 464.85001 467.88599 472.89001 478.30081 484.18079 487.2048 492.20999 495.94199 498.46439"
         y="207"
         id="tspan154">Han vil købe en brugt, ________________ tyve er normalt ikke så interesserede i at stjæle gamle cykler. </tspan><tspan
         x="0 5.7119999 11.916 16.176001 21.1812 27.7332 30.769199 36.6492 39.841202 45.335999 50.785198 55.7892 60.193199 63.229198 68.246399 71.7864 75.388802 80.392799 84.796799 87.832802 92.837997 99.389999 102.426 108.57 113.0568 119.5368 125.0088 128.7168 131.75281 136.75681 142.1664 147.83279 152.8968 155.92081 158.9568 165.2928 170.5248 173.56081 180.11279 185.18761 188.8956 192.498 197.5728 201.28081 203.80321 206.8392 213.5352 216.5004 222.98039 229.31641 233.5764 238.63921 241.66319 244.85519 250.32719 253.3632 257.6232 262.62839 267.03241 270.06839 276.46439 281.69641 288.24841 291.28439 296.28839 302.84039 305.8764 311.1084 317.6604 324.2124 330.38159 336.93359 341.80441 346.84439 349.8804 359.7684 364.83121 371.16721 374.20319 379.27802 382.98599 386.022 392.16721 395.35919 398.44199 401.466 406.52881 412.82999 417.87 420.90601 426.138 430.03439 433.0704 438.0744 444.6264 447.66241 452.66641 458.07721 463.74359 468.8064 471.83041 474.35281 477.38879 483.69 488.69519 493.09921"
         y="234"
         id="tspan156">Søren kigger efter en brugt cykel på nettet. Pludselig ser han en annonce med et billede af en cykel, der </tspan><tspan
         x="0 3.0239999 6.2160001 11.82 18.372 23.375999 27.780001 30.816 37.117199 42.122398 48.6744 51.1968 54.2328 60.628799 65.860802 72.412804 75.448799 81.844803 87.076797 91.480797 94.5168 98.056801 103.2888 108.3636 112.0716 115.1076 119.3676 123.0756 126.1356 131.3676 134.3916 139.4664 143.17439 145.69679 148.7328 157.746 162.978 169.53 172.56599 177.10201 180.29401 186.84599 192.29401 197.29919 201.7032 204.7392 208.48199 211.674 214.698 217.73399 224.034 229.0392 235.5912 238.6272 244.5072 250.17 253.362 259.914 266.21399 271.254 273.7764 276.81241 283.11359 288.1188 292.5228 295.55881 301.2204 304.41241 307.4364 310.47241 316.47241 322.47241 328.47241 334.47241 340.47241 346.47241 352.47241 358.47241 364.47241 370.47241 376.47241 382.47241 388.47241 394.47241 400.47241 406.47241 409.50839 414.51239 419.92319 425.80319 428.82721 433.8324 440.3844 442.9068 445.94281 452.16959 457.6416 460.67761 466.97879 472.0188 475.05481 480.2868 483.82681 487.53479 492.76682"
         y="261"
         id="tspan158">ligner den, han har fået stjålet. Han ringer til den kvinde, der vil ________________ cyklen, og de afta-</tspan><tspan
         x="0 3.0239999 8.0291996 11.7612 14.2848 17.320801 22.552799 26.260799 29.296801 35.692799 40.924801 47.476799 50.512798 56.392799 61.624802 68.176804 71.212799 76.855202 83.024399 92.912399 102.8004 107.8404 110.8764 117.1032 122.5752 125.6112 129.8712 134.91119 137.9472 144.2484 149.2524 155.8044 158.84039 165.3924 173.2404 177.5004 181.1028 186.14281 189.1788 195.5148 200.7468 206.3616 208.88519 211.9212 217.63319 223.8372 228.0972 233.1012 239.6532 242.68919 246.3972 251.6292 257.0784 262.0824 266.48639 269.5224 275.9184 278.97839 283.98361 293.87161 296.90759 300.65039 303.84241 306.86639 309.9024 315.78241 321.444 324.63599 331.18799 337.4892 342.49438 349.04639 351.5676 354.60361 360.83041 366.3024 369.33841 375.73441 380.9664 387.5184 390.55441 396.43439 401.66641 408.21841 411.25439 415.5144 419.29321 423.7908 429.0228 434.9028 439.16281 442.19879 446.4588 451.49881 454.02121 457.05719 462.28922 465.99719 469.0332 475.33441 480.40921 484.11719 487.1532 492.15839 496.56241"
         y="288"
         id="tspan160">ler, at han kan komme og se den næste dag. Søren tager hjem til kvinden, og han kan straks se, at det er </tspan><tspan
         x="0 6.3011999 11.3052 17.857201 20.8932 25.8972 31.308001 36.9744 42.038399 45.062401 47.583599 50.619598 57.015598 62.247601 68.799599 71.835602 78.231598 83.4636 87.867599 90.903603 94.443604 99.675598 104.7504 108.4584 111.4944 115.7544 119.4624 122.5224 127.7544 130.7784 135.8532 139.5612 142.0836 145.1196 152.7168 158.12759 164.0076 167.0316 172.0368 178.58881 181.6248 188.0208 193.25281 197.6568 200.69279 206.69279 212.69279 218.69279 224.69279 230.69279 236.69279 242.69279 248.69279 254.69279 260.69281 266.69281 272.69281 278.69281 284.69281 290.69281 296.69281 299.72879 304.73401 311.28601 314.32199 324.20999 329.29681 334.74481 339.81961 343.52759 346.5636 350.82361 357.21841 362.28241 367.28641 370.47839 375.5412 378.56519 381.6012 386.13721 389.32919 395.8812 401.32919 406.3692 412.24921 415.27319 421.4772 427.35721 433.0224 438.06241 441.09839 447.3252 452.79721 455.83319 460.83841 467.39041 470.42639 474.6864 479.94241 486.27841 492.57959 497.6424 500.66641 503.18881"
         y="315"
         id="tspan162">den cykel, han har fået stjålet. Cyklen har ________________ en meget speciel ringeklokke og en saddel, </tspan><tspan
         x="0 4.2600002 10.4292 20.3172 23.353201 28.357201 32.7612 35.797199 41.269199 46.501202 51.576 55.284 58.32 61.344002 64.536003 70.872002 74.580002 77.615997 80.807999 83.844002 88.103996 91.966797 97.377602 103.2576 108.924 113.9292 118.3332 121.3692 124.5612 127.5972 131.85719 135.04919 141.3504 146.35561 152.90759 155.42999 158.466 164.17799 170.382 174.642 179.646 186.198 189.23399 195.63 200.862 205.26601 208.302 211.2912 216.6192 220.8792 224.5872 227.6232 231.3672 234.5592 237.58321 240.6192 245.8512 249.5592 252.5952 256.30319 261.53519 266.98318 272.02319 275.0592 279.31921 282.5112 289.0632 292.09921 297.10321 302.51401 308.18039 313.24319 316.26721 318.78961 321.82559 327.82559 333.82559 339.82559 345.82559 351.82559 357.82559 363.82559 369.82559 375.82559 381.82559 387.82559 393.82559 399.82559 405.82559 411.82559 417.82559 420.8616 427.16281 432.23761 435.94559 438.9816 444.45361 450.65759 455.06161 458.0976 464.49359 469.72559 476.27759 479.3136 482.50562 488.38559 494.05081 499.09079 501.61319"
         y="342"
         id="tspan164">som er gået lidt i stykker i siden. Søren har lyst til at tage sin cykel, ________________ det gør han ikke. </tspan><tspan
         x="0 4.0320001 7.0679998 11.328 14.9304 19.9944 26.294399 31.3692 35.077202 38.113201 42.373199 45.565201 51.0144 56.018398 60.422401 63.458401 69.854401 75.086403 81.638397 84.6744 88.417198 91.6092 94.633202 97.669197 103.5492 109.212 112.404 118.956 125.256 130.2612 136.8132 139.3356 142.3716 147.60361 151.3116 154.3476 160.74361 165.9756 172.5276 175.5636 178.7556 184.6356 190.3008 195.34081 198.3768 203.382 207.786 210.82201 214.01401 220.56599 224.16721 229.17239 233.4324 238.4724 242.73241 246.9924 251.9976 256.2576 261.3324 265.04041 268.07639 271.2684 274.30441 279.53641 283.24438 286.2804 292.1604 298.36441 304.57919 309.6192 312.65521 318.95639 323.96161 330.51361 333.03601 336.07199 341.784 347.01599 350.052 354.31201 357.504 362.952 367.95721 372.36121 375.39719 381.79321 387.02521 393.57721 396.61319 400.1532 405.38519 410.0412 415.33441 420.39841 423.42239 426.4584 432.68521 438.1572 441.19321 444.90121 450.13321 455.58121 460.5864 464.99039 468.0264 474.3624 479.59439 482.6304 489.00119 495.2052 498.22919 501.4212"
         y="369"
         id="tspan166">I stedet siger han til kvinden, at han ikke er interesseret i at købe den. Så siger han farvel og tager på poli-</tspan><tspan
         x="0 3.7428 6.9348001 11.1948 14.9028 20.1348 23.8776 27.069599 33.2388 39.790798 44.7948 51.346802 54.382801 60.610802 66.082802 69.118797 72.622803 78.792 83.397598 87.105598 94.953598 98.0364 101.0604 106.0656 109.7976 112.3212 115.3572 121.4544 126.7356 132.9048 137.30881 140.3448 146.7408 151.97279 158.5248 162.78481 165.8208 170.8248 176.2356 181.90199 186.9648 189.9888 193.0248 198.03 201.7632 204.2856 207.32159 213.8748 217.58279 220.6188 226.9548 232.1868 236.59081 239.6268 245.9628 251.19479 256.64279 261.6828 264.71881 269.73599 273.276 276.87839 281.88361 286.2876 289.32361 293.8584 297.05042 303.60239 309.05161 314.0556 318.45959 321.49561 327.86639 334.0704 337.09439 340.28641 344.0304 347.22241 352.29721 356.00519 359.0412 362.784 365.97601 369 372.03601 377.74799 383.952 388.21201 393.21719 399.7692 402.80521 409.03201 414.504 417.54001 421.79999 424.992 430.44 435.44519 439.17841 441.70081 444.73679 449.96881 453.67679 456.7128 463.1088 468.34079 474.89279 477.9288 483.80881 489.0408 495.5928"
         y="396"
         id="tspan168">tistationen og fortæller, hvor hans cykel er. Et par dage efter ringer politiet til Søren og siger, at han kan </tspan><tspan

    <text

         id="tspan130">Jakob er ansat i et fitnesscenter, men han laver også frivilligt arbejde ved siden af. Han er frivillig </tspan><tspan

       id="text152"><tspan

         y="0"
         id="tspan144">Jakob er 28 år og bor i Kalundborg. Han arbejder på fuld tid som instruktør i et fitnesscenter. Men </tspan><tspan
         x="0 6.3959999 11.628 18.18 21.216 26.448 30.994801 37.209599 42.3936 45.453602 51.754799 56.758801 61.1628 64.198799 70.426804 75.968399 80.228401 85.460403 88.496399 92.756401 98.925598 108.8136 111.8496 115.3896 119.9244 123 128.66161 131.85361 134.9364 137.9604 141.1524 146.6244 149.6604 155.8056 160.30321 165.5352 172.0872 178.4232 188.3112 193.5432 200.0952 206.4312 208.95239 211.9884 220.8588 226.3308 229.36681 235.66679 240.7428 244.45081 247.4868 252.492 256.896 259.93201 266.23318 271.2384 275.6424 278.67841 283.68359 290.2356 293.27161 299.57281 304.63559 307.65961 310.69559 315.92761 322.47961 328.81561 333.07559 338.1156 341.15161 344.3436 347.37961 354.9888 360.22079 363.186 369.66599 376.21799 382.55399 388.7688 394.93799 399.34201 404.95679 407.47919 410.5152 416.81641 421.82159 426.22559 429.2616 435.48959 441.03119 445.2912 450.52319 453.5592 459.03119 465.2352 468.96841 471.49081"
         y="24"
         id="tspan146">han arbejder også som frivillig brandmand. Og det er der en del andre i Kalundborg, der også gør. </tspan><tspan
         x="0 6 12 18 24 30 36 42 48 54 60 66 72 78 84 90 96 98.5224 101.5584 107.5248 113.6928 118.0968 121.1328 127.6848 133.9128 139.55161 142.57561 147.6156 150.6516 156.1824 161.4144 167.9664 173.4144 178.45441 181.4904 187.6344 192.03841 199.8864 206.4384 212.73959 217.7448 222.1488 225.1848 231.4848 236.56081 240.2688 243.30479 246.8448 249.8688 254.87399 259.134 264.17401 267.20999 271.47 275.07239 280.13641 286.43759 291.44159 295.84561 298.88159 305.21759 310.44958 313.4856 318.49081 325.04279 328.0788 333.6084 338.84039 345.3924 351.00839 353.53079 356.5668 362.79361 368.26559 371.30161 375.56161 380.79361 383.82959 388.83481 393.2388 396.27481 402.57599 407.57999 411.98401 415.01999 418.21201 424.09201 429.75839 434.7984 437.83441 441.37439 446.60641 450.86639 454.5744 459.8064 466.3584"
         y="48"
         id="tspan148">________________. For nogle gange brænder det flere steder på en gang, og så er der ikke fastan-</tspan><tspan
         x="0 4.2600002 9.4919996 13.2 16.802401 21.8424 24.878401 31.0236 35.52 40.751999 47.304001 53.639999 63.528 71.375999 77.928001 84.264 87.300003 93.851997 100.056 105.936 108.972 112.7148 115.9068 118.9308 121.9668 127.1988 130.9068 133.94279 139.8228 142.8468 148.0788 152.33881 157.3788 160.41479 166.56 172.94279 178.4736 183.50281 188.79601 193.80119 198.2868 204.83881 209.8788 212.4012 215.43719 224.1972 229.20239 233.664 237.1692 243.33839 247.7424 250.7784 255.78239 260.1864 263.22241 269.52359 274.5636 277.59961 281.13959 285.6756 288.75 294.41281 297.6048 300.6864 303.71039 306.9024 312.35159 317.3916 320.42761 326.0892 329.28119 334.7532 338.496 341.68799 347.13721 352.17719"
         y="72"
         id="tspan150">satte brandmænd nok til at klare opgaverne. Derfor er de frivillige vigtige.</tspan></text>

       id="text166"><tspan

         y="0"
         id="tspan158">På Vestsjælland, hvor Jakob bor, er der 135 frivillige brandmænd. De arbejder til dagligt inden for </tspan><tspan
         x="0 9.8879995 14.9748 20.4228 25.4988 29.2068 32.242802 35.746799 41.916 46.296001 50.556 56.222401 61.285198 64.367996 67.391998 70.584 76.033203 81.073196 84.1092 87.6492 92.881203 98.353203 101.3892 105.6492 111.8184 121.7064 124.7424 130.89841 133.92239 136.8024 142.03439 144.55679 147.5928 153.73801 160.218 164.478 169.3992 175.7952 181.02721 187.5072 191.0472 194.5872 200.7912 205.05119 210.0564 213.7896 216.312 219.34801 225.68401 233.532 239.868 245.10001 250.524 256.75201 262.20001 267.2052 271.60919 274.6452 280.8732 286.34521 289.3812 293.0892 296.1492 301.15439 307.70639 312.71161 316.97159 322.0116 324.534 327.57001 333.57001 339.57001 345.57001 351.57001 357.57001 363.57001 369.57001 375.57001 381.57001 387.57001 393.57001 399.57001 405.57001 411.57001 417.57001 423.57001 426.09241 429.12839 437.8884 442.92841 445.96439 450.2244 455.58841 462.14041 467.18039 471.4404"
         y="24"
         id="tspan160">meget forskellige fag som bl.a. buschauffører, pædagoger og tjenere. ________________. De synes </tspan><tspan
         x="0 5.2319999 8.3148003 11.3388 16.378799 19.414801 23.674801 28.906799 38.7948 48.6828 53.686798 60.2388 62.7612 65.797203 71.029198 74.737198 77.773201 84.073196 89.1492 92.857201 95.893204 100.8972 105.3012 108.3372 113.3424 119.8944 122.9304 128.5932 131.7852 137.2572 141 144.192 149.664 152.7 158.8452 165.228 170.7588 175.78799 181.08121 186.1212 189.1572 194.38921 198.0972 201.13319 206.6172 214.46519 218.7252 223.7652 226.80119 230.3412 234.8772 237.9516 243.6144 246.8064 249.88921 252.91319 256.10519 261.57721 264.61319 270.75839 275.25601 280.48801 287.04001 293.37601 303.26401 308.496 315.048 321.384 323.9064 326.94241 333.16919 338.6412 341.67719 347.97839 353.0184 356.05441 361.0596 365.46359 368.4996 374.37961 377.40359 382.63559 387.03961 390.07559 393.81839 397.01041 400.03439 403.0704 408.3024 412.01041 415.04639 421.44241 424.50241 432.3504 435.37439 441.7692 446.8092 449.84521 455.07721 461.62921 467.96521 472.22519 477.2652"
         y="48"
         id="tspan162">alle sammen, at det er en vigtig opgave at være frivillig brandmand, og de er klar til at hjælpe andre </tspan><tspan
         x="0 9.8879995 14.892 21.444 27.996 33.035999 37.296001 42.962399 47.967602 52.371601 55.4076 61.634399 67.1064 70.142403 74.402397 79.4664 85.802399 92.102402 97.142403 100.1784 103.2024 106.278 111.1404 113.6628 116.6988 123.2508 128.4828 132.8868 135.92281 142.22279 147.228 151.632 154.668 159.6732 164.07719 167.1132 173.2572 177.744 184.224 189.696 192.73199 196.2372 202.4064 206.81039 209.84641 216.1476 221.2224 224.9304 227.4528"
         y="72"
         id="tspan164">mennesker og redde liv, når der er brug for det. </tspan></text>

       id="text180"><tspan
         x="0 5.9664001 12.1344 16.538401 19.562401 24.794399 28.502399 31.5264 36.7584 41.3064 47.521198 52.7052 55.765202 62.065201 67.105202 70.129204 74.389198 80.558403 90.446404 93.470398 99.615601 104.1132 109.3452 115.8972 122.2332 132.1212 137.3532 143.9052 150.2412 153.2652 157.52521 163.4052 168.63721 171.66119 174.6852 184.5732 189.80521 196.35719 199.3812 204.8652 212.7132 216.97321 222.0132 225.0372 234.9252 238.1172 244.6692 251.0052 255.2652 258.97321 261.99719 267.7572 273.51721 276.5412 281.77319 285.50641 288.02881 291.0528 297.2796 302.75159 305.7756 315.6636 320.8956 327.4476 330.47159 334.7316 340.6116 345.8436 348.86761 351.8916 357.37561 365.2236 369.48361 374.52359 377.54761 380.73959 383.76361 389.18759 395.42761 401.76361 404.7876 408.32761 413.6568 417.91681 421.1088 425.3688 431.24881 434.2728 437.77802 443.9472 448.4328 458.3208 460.8432 463.86719 474.39359 479.62561 486.17761"
         y="0"
         id="tspan172">For at arbejde som brandmand skal man være mindst 18 år, og man skal være i god fysisk form. Man </tspan><tspan
         x="0 4.2600002 10.14 15.372 18.396 21.431999 27.983999 32.987999 42.875999 45.900002 49.091999 54.563999 57.599998 61.3428 64.534798 68.242798 71.278801 77.458801 85.306801 89.566803 94.606796 97.642799 101.3388 107.8188 114.3708 119.82 124.86 127.896 131.63879 134.8308 141.3828 146.8548 149.89079 156.1176 161.5896 164.6256 168.8856 174.1176 184.0056 187.7484 190.9404 197.2764 200.4684 205.9404 208.97639 215.19119 220.31281 225.7968 233.64481 239.09399 244.134 247.17 251.42999 254.62199 260.09399 263.13 269.45639 275.9364 280.54199 284.28479 287.47681 292.94879 296.6568 299.1792 302.21521 312.10321 317.1084 323.6604 327.92041 330.95639 340.84439 346.07639 352.62839 355.6644 362.06039 367.29239 371.69641 374.73239 381.12839 384.18839 389.25119 392.27521 402.16321 405.19919 411.42719 416.8992 419.93521 426.41519 432.96719 436.15921 439.66321 445.8324 450.31799 460.20599 463.242 469.578 474.81 477.3324"
         y="24"
         id="tspan174">skal nemlig tit bære tunge ting og samtidig bevæge sig hurtigt, mens man har hjelm og uniform på. </tspan><tspan
         x="0 6 12 18 24 30 36 42 48 54 60 66 72 78 84 90 96 98.5224 101.5584 107.5248 113.6928 118.0968 121.1328 127.434 132.5088 136.2168 139.25281 144.258 148.662 151.698 157.36079 160.5528 166.0248 169.76759 172.95959 178.43159 182.1396 184.662 187.698 192.92999 196.638 199.674 209.562 214.79401 221.34599 224.382 227.57401 233.45399 239.12041 244.1604 247.1964 253.3524 256.3764 259.45081 264.74399 269.74921 274.1532 277.18921 283.74121 288.7464 293.40121 298.88519 305.0892 309.34921 312.38519 315.57721 318.61319 322.1532 327.38519 331.836 334.85999 338.052 343.5 348.54001 351.57599 357.80399 363.276 366.31201 370.57199 374.34961 378.61081 383.65079 387.9108 392.17081 397.1748 403.72681 410.02802 415.06799 418.104 422.36401 425.556 429.25201 435.73199 440.96399 444.70679 447.8988 454.0668 460.6188 465.62399 469.35721 471.87961"
         y="48"
         id="tspan176">________________. For det er vigtigt, at man ikke bliver nervøs i farlige og stressende situationer. </tspan><tspan
         x="0 8.8691998 14.3412 17.377199 21.637199 26.8692 29.905199 34.165199 40.0452 45.277199 48.301201 51.3372 61.225201 66.457199 73.009201 76.045197 82.272003 87.814796 92.074799 97.306801 100.3428 105.8268 113.6748 117.9348 122.9748 126.0108 131.436 137.67599 144.01199 147.048 150.7908 153.9828 157.00681 160.0428 165.2748 168.9828 172.0188 176.27879 181.5108 191.3988 196.6308 201.1776 207.3924 212.5764 215.6364 221.9364 226.97639"
         y="72"
         id="tspan178">Og så skal man også være god til at samarbejde.</tspan></text>

         x="0 6.0971999 11.76 14.952 19.212 22.247999 28.548 33.624001 37.332001 40.368 46.512001 50.916 58.764 65.316002 71.617203 76.621201 81.0252 84.061203 89.136002 92.844002 95.879997 100.14 103.7424 108.8064 115.1424 118.1784 121.3704 124.4064 130.45441 135.67439 140.6796 147.2316 149.754 152.78999 161.68201 166.914 171.31799 174.354 180.65401 185.65919 190.0632 193.0992 198.1044 202.50841 205.5444 211.68961 216.18719 221.4192 227.97121 234.30721 236.82961 239.8656 243.40559 248.6376 253.0416 256.07761 259.79999 265.03201 270.67441 276.86639 283.04639 286.0824 291.08759 297.63959 300.6756 304.93561 314.82361 319.08359 322.1196 328.4556 333.68759 336.7236 340.98361 344.1756 350.7276 353.76361 363.65161 369.8436 375.98761 379.1796 382.20361 385.806 390.87 393.89401 398.91 402.41519 408.58441 415.13641 417.65759 420.6936 426.40561 431.6376 434.67361 441.06961 446.30161 450.7056 453.74161 460.1376 465.3696 471.9216"
         y="24"
         id="tspan148">hvis det brænder et sted i byen. Når der er brand, får Jakob en sms på sin mobiltelefon. Så har han </tspan><tspan
         x="0 5.0040002 8.1960001 12.6696 18.549601 23.781601 26.8176 30.3228 35.327999 45.216 48.251999 58.139999 61.332001 67.801201 74.245201 77.953201 81.555603 86.560799 90.964798 94.000801 97.743599 100.9356 103.9596 106.9956 112.2276 115.9356 118.9716 124.614 130.7832 140.6712 150.5592 155.5992 158.63519 165.0312 170.0352 176.5872 179.6232 183.366 186.558 189.582 192.618 198.7632 203.2608 208.4928 215.0448 221.3808 225.64079 229.3488 234.5808 238.32359 241.51559 247.68359 254.2356 259.24081 265.79279 268.31519 271.3512 277.3512 283.3512 289.3512 295.3512 301.3512 307.3512 313.3512 319.3512 325.3512 331.3512 337.3512 343.3512 349.3512 355.3512 361.3512 367.3512 369.8736 372.90961 378.87601 385.04401 389.448 392.48401 396.02399 399.216 402.99481 409.54681 414.58679 418.8468 423.10681 427.97879 432.98279 439.53479 443.3136 447.57361 452.64841 456.35641 459.3924 462.41641 465.6084 471.10321 476.5524 481.5564 485.96039"
         y="48"
         id="tspan150">cirka fem minutter til at komme hen til brandstationen. ________________. For fitnesscentret ligger </tspan><tspan
         x="0 3.0239999 6.2160001 11.664 16.704 19.74 25.034401 30.0972 36.433201 39.4692 43.729198 46.9212 53.222401 58.226398 64.778397 67.8144 73.046402 76.944 79.980003 86.125198 90.622803 95.854797 102.4068 108.7428 113.0028 116.7108 121.9428 125.6844 128.8764 135.04559 141.5976 146.6028 153.1548 155.6772 158.7132 162.97321 168.2052 171.2412 177.63721 182.8692 189.4212 192.4572 198.3372 203.5692 210.1212 213.1572 217.41721 222.6492 228.1212 231.7236 236.7276 243.2796 247.5396 250.57561 256.21799 262.38721 272.27521 282.16321 287.20319 290.2392 296.56439 303.0444 307.64999 311.39401 314.586 320.05801 323.76599 326.802 330.34201 334.60199 339.60599 349.49399 352.01639"
         y="72"
         id="tspan152">lige ved siden af brandstationen, så han kan sagtens komme hurtigt frem. </tspan></text>

         y="0"
         id="tspan160">Brandmændene skal klare mange forskellige situationer, og det er ikke kun, når der er ild i et hus, at </tspan><tspan
         x="0 6.3011999 11.3412 14.3772 20.2572 26.461201 30.721201 35.726398 40.130402 43.166401 48.398399 52.2948 55.330799 59.590801 63.193199 68.257202 74.593201 77.629204 80.821198 83.857201 90.001198 94.498802 99.730797 106.2828 112.6188 118.764 121.956 124.98 129.98399 136.536 139.0596 142.0956 148.0956 154.0956 160.0956 166.0956 172.0956 178.0956 184.0956 190.0956 196.0956 202.0956 208.0956 214.0956 220.0956 226.0956 232.0956 238.0956 240.6192 243.6552 249.83521 255.4632 258.49921 264.37921 269.61121 276.16321 279.19919 285.5004 290.5752 294.2832 297.31921 301.57919 307.24561 312.28561 314.80801 317.84399 323.07599 326.784 329.82001 334.82401 341.37601 344.41199 350.80679 355.81201 360.19199 364.452 370.62119 377.17319 380.2092 384.74399 387.936 394.48801 399.93719 404.94119 408.67441 411.19681 414.23279 417.73801 423.9072 428.16721 434.5032 437.69519 440.7312 445.7352 452.2872 455.32321 461.20319 466.43521 470.14319 473.1792 478.18439 482.58841"
         y="24"
         id="tspan162">de kører af sted i brandbilen. ________________. Fx kan det ske, at en person ringer, fordi en kat er </tspan><tspan
         x="0 5.6423998 11.8116 21.6996 31.587601 36.662399 40.370399 43.406399 47.666401 52.898399 55.934399 62.330399 68.534401 71.594398 75.302399 78.338402 84.483597 90.819603 93.855598 97.0476 100.0836 105.1584 108.8664 111.9024 115.68 120.084 127.932 130.45441 133.4904 138.7224 142.4304 145.4664 151.76759 156.77161 163.32359 166.3596 169.55161 175.43159 181.09801 186.138 189.174 193.43401 198.4968 201.4032 206.88721 209.9232 215.80321 221.0352 227.5872 230.6232 236.26559 242.4348 252.3228 262.21078 267.25079 270.2868 276.83881 281.90161 288.23761 291.27359 294.46561 299.9136 304.91879 311.47079 313.99319 317.02921 322.74121 327.97321 331.00919 336.65161 342.8208 352.7088 362.5968 367.6008 372.00479 375.0408 378.76321 383.99521 389.6376 395.83081 402.0108 405.04681 411.27359 416.74561 419.78159 426.17761 431.40961 437.96161 442.22159 445.2576 450.89999 457.104 460.1868 463.21078 468.29761 473.74561 478.75079 482.48401 485.00641"
         y="48"
         id="tspan164">kommet så højt op i et træ, at den ikke selv kan komme ned igen. Så kommer Jakob og hans kolleger. </tspan><tspan
         x="0 8.7600002 13.8 16.836 22.98 27.466801 33.9468 39.394798 44.400002 48.804001 51.84 58.139999 63.145199 69.697197 72.7332 75.757202 80.989197 87.541199 92.989197 98.029198 101.0652 105.3252 109.068 112.26 117.708 122.748 125.2716 128.3076 134.6076 139.6476 142.68359 149.07961 154.3116 158.71561 161.7516 168.0876 173.3196 176.35561 182.50079 186.9984 192.23039 198.78239 205.11839 211.26241 214.45441 217.47839 222.4836 229.0356 231.558 234.59399 238.33681 241.52879 244.5528 247.58881 252.8208 256.52881 259.56479 265.44479 269.94241 274.97159 280.5144 283.53839 288.5784 291.61441 297.75961 304.09561 307.13159 310.87439 314.06641 317.09039 320.1264 326.00641 331.2384 334.94641 338.5488 343.5528 350.1048 353.14081 359.3688 364.84079 367.8768 374.2728 379.27679 385.8288 389.43121 394.47119 397.5072 403.80841 408.8136 415.3656 418.40161 424.95361 430.01639 436.35239 439.3884 442.58041 448.02841 453.0336 459.5856 462.108"
         y="72"
         id="tspan166">De bruger den lange stige, de har på brandbilen, til at kravle op til katten og hente den ned igen. </tspan></text>

         x="0 7.7052002 10.7868 13.8108 18.816 23.076 28.139999 34.4412 39.481201 42.5172 48.853199 54.085201 57.121201 60.181198 65.2668 70.7388 73.774803 79.270798 84.5028 88.906799 91.942802 94.966797 98.158798 101.2416 104.2656 109.3056 111.828 114.864 120.744 127.224 133.776 140.328 145.368 148.40401 151.464 156.5508 162.0228 165.05881 170.48399 176.72279 183.05881 186.7668 189.8028 192.8268 196.0188 202.32001 207.36 210.396 215.62801 219.336"
         y="0"
         id="tspan98">Allerede da jeg var lille, kunne jeg godt lide at </tspan><tspan
         x="0 6.3959999 9.4560003 17.304001 20.327999 26.722799 31.7628 34.798801 44.686798 47.878799 54.430801 57.466801 67.354797 73.524002 77.928001 80.963997 84.155998 87.192001 93.071999 99.276001 105.156 110.8212 115.8264 122.3784 127.4532 131.16119 133.68359 136.7196 140.39281 145.4796 150.9516 153.98759 159.48241 164.7144 169.11839 172.1544 175.34641 179.6064 187.45441 191.8584 194.89439 200.5332 203.55721 208.812 215.14799"
         y="15.996"
         id="tspan100">hjælpe min mor i køkkenet. Jeg var især glad </tspan><tspan
         x="0 3.5051999 9.6731997 14.0772 17.113199 22.3452 26.0532 29.089199 32.113201 37.1436 42.436798 47.476799 50.512798 56.656799 61.060799 67.264801 73.6008 76.636803 82.864799 88.3368 91.372803 97.2528 102.4848 107.9328 112.938 116.67 119.1936 122.2296 131.0988 136.5708 139.6068 142.66679 147.7536 153.2256 156.2616 161.3244 164.3484 168.6084 174.2748 179.27879 183.6828 186.7188 190.97881 194.6868 199.94279 206.27879 209.47079 214.94279"
         y="31.992001"
         id="tspan102">for at lave brød og kager. Og jeg elsker stadig </tspan><tspan
         x="0 5.2319999 8.9399996 11.976 17.208 21.754801 27.9708 33.153599 36.2136 42.514801 47.554798 50.590801 60.478802 65.541603 71.877602 74.913597 84.801598 87.993599 94.545601 99.585602 102.6216 109.0176 116.8656 123.4176 129.71761 134.72279 139.1268 142.1628 148.3896 153.8616 156.8976 163.07761 168.3096 173.7588 178.7988 181.83479 187.97881 192.3828 198.58681 204.92281 207.9588 214.1868 219.6588"
         y="47.987999"
         id="tspan104">at arbejde med mine hænder og bage brød og </tspan><tspan
         x="0 6.3011999 11.3412 16.983601 23.1516 27.4128 32.416801 36.678001 41.717999 44.754002 50.633999 55.866001 61.313999 66.319199 70.052399 72.574799 75.610802 81.3228 86.554802 89.590797 92.650803 97.737602 103.2096 106.2456 112.6416 117.8736 122.2776 125.3136 128.85361 134.0856 139.96561 143.7084 146.90041 151.1604 157.04041 160.0764 165.3084 168.3324 172.0752 175.2672 181.6032 184.63921 190.302 193.494 199.83 204.09 207.798 210.3192 213.35519 218.5872 222.2952"
         y="63.984001"
         id="tspan106">dekorere kager. Så jeg har faktisk altid vidst, at </tspan><tspan
         x="0 6.3011999 11.376 15.084 18.120001 23.615999 28.848 33.251999 36.287998 42.589199 47.664001 51.372002 53.894402 56.930401 59.990398 65.077202 70.549202 73.585197 79.248001 82.440002 85.522797 88.546799 93.5868 96.622803 101.8548 106.4016 112.6164 117.8004 120.8604 127.1616 132.2016 135.23759 145.1256 150.1884 156.5244"
         y="79.980003"
         id="tspan108">det var det, jeg ville arbejde med.</tspan><tspan
         x="272.12399 279.82919 282.91199 285.936 290.97601 294.01199 298.272 301.29599 306.52802 312.0708 316.33081 319.55881 322.59479 332.97601 337.9812 344.5332 347.56921 351.82919 356.892 359.79959 365.2836 368.82361 375.02759 378.05161 383.4996 388.56241 391.5864 394.77841 400.2504 403.28641 413.17441 418.21439 422.4744 426.1824 429.21841 435.77039 441.99841 447.63721 450.66119 455.7012 458.2236 461.25961 467.5596 472.56479 476.96881 480.00479 486.2196 492.38879 496.79279"
         y="-0.024"
         id="tspan110">Alle slags! Men selvfølgelig mest nogle, der bor </tspan><tspan
         x="272.12399 277.18799 280.26959 283.29361 288.2988 292.70279 295.7388 300.97079 305.51761 311.73361 316.91641 319.97641 326.27759 331.28281 335.6868 338.72281 345.1188 350.12399 354.52802 357.564 363.89999 369.13199 372.168 381.108 385.36801 388.9704 393.9744 398.5224 404.6676 408.90359 414.8208 417.3432 420.37921 428.93759 435.1644 440.80441 443.8284 448.86841 451.90439 457.13641 461.03281 464.06879 470.37 475.37521 485.26321"
         y="15.972"
         id="tspan112">eller arbejder her på Østerbro. Nogle af dem </tspan><tspan
         x="272.12399 277.76639 283.93561 293.82361 303.71161 308.71561 313.1196 316.15561 322.25281 327.54599 332.55121 336.9552 339.99121 346.32721 351.5592 357.03119 360.0672 366.29401 371.76599 374.802 380.034 386.586 392.922 397.18201 402.22198 405.258 410.33401 414.04199 417.078 423.414 428.646 433.04999 436.086 441.61679 446.84879 453.40079 458.84879 463.88879 466.9248 473.09399 482.98199"
         y="31.968"
         id="tspan114">kommer hver dag og andre et par gange om </tspan><tspan
         x="272.12399 278.604 284.052 289.05719 295.60919 298.13159 301.1676 311.69281 316.9248 323.47681 328.92599 333.966 337.00201 342.23401 346.13159 349.1676 355.46881 360.474 370.362 373.39801 379.79401 385.026 389.42999 392.466 398.34601 404.54999 410.754 414.46201 417.49799 423.642 428.04599 434.25 440.586 443.62201 450.01801 456.22198 460.48199 463.51801 473.40601 476.59799 482.07001 485.10599 488.298"
         y="47.964001"
         id="tspan116">ugen. Mange af dem har købt brød hos mig i </tspan><tspan
         x="272.12399 275.664 278.68799 283.69321 287.95319 292.99319 296.02921 301.2612 304.99438 307.51682 310.5528 314.81281 320.0448 323.08081 329.3808 334.38599 344.27399 347.31 352.97641 357.98041 364.53241 370.83359 375.83881 380.2428 383.27881 386.33881 391.42441 396.89639 399.9324 404.94958 408.48959 412.09201 417.09601 421.5708 427.9668 433.19879 439.75079 446.05081 451.056 457.608 460.64401 465.17999 468.37201 473.84399 477.58679 480.77881 486.25079"
         y="63.959999"
         id="tspan118">flere år, så dem kender jeg efterhånden rigtig </tspan><tspan
         x="272.12399 277.54919 283.78799 290.12399 293.832 296.3544 299.39041 308.15039 313.22519 316.9332 319.96921 324.9744 329.37839 332.4144 338.53439 343.87439 349.37039 354.81839 359.88239 362.9064 366.09839 371.5704 375.27841"
         y="79.956001"
         id="tspan120">godt. Det er hyggeligt.</tspan></text>

    <text

       transform="matrix(1,0,0,-1,72.0236,449.9758)"
       style="font-variant:normal;font-weight:normal;font-stretch:normal;font-size:12px;font-family:Minion;-inkscape-font-specification:Minion-Regular;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text152"><tspan
         x="0 8.7600002 13.8348 17.542801 20.5788 25.872 30.936001 37.271999 40.307999 43.368 48.453602 53.925598 56.961601 60.153599 66.0336 71.699997 76.739998 79.776001 86.171997 91.234802 94.258797 97.966797 100.4892 103.5252 113.4132 118.4184 124.9704 128.00639 137.89439 143.1264 147.3864 153.05161 158.0916 161.12759 167.6796 173.90759 179.5464 182.5704 187.6104 190.64639 195.8784 199.7748 202.81081 209.11079 214.1508"
         y="0"
         id="tspan128">Det ved jeg ikke helt, men måske nogle af de </tspan><tspan
         x="0 5.8800001 11.112 16.559999 21.565201 25.298401 27.820801 30.8568 35.116798 41.285999 51.174 54.209999 57.27 62.3568 67.828796 70.864799 74.056801 79.936798 85.603203 90.643204 93.679199 99.8592 105.0912 110.5392 115.5444 119.9484 122.9844 129.0804 134.3748 139.3788 143.78281 146.8188 153.1548 158.3868 164.00281 166.52521 169.5612 175.27319 180.5052 183.5412 189.8412 194.91721 198.6252 201.66119 206.66521 211.0692"
         y="15.996"
         id="tspan130">kager, som jeg ikke bager hver dag. Så det er </tspan><tspan
         x="0 6.552 12.756 18.636 21.672001 27.816 32.542801 37.953602 41.0364 44.001598 50.481602 56.8176 61.077599 66.957603 72.189598 77.637604 82.642799 86.374802 88.898399 91.934402 97.900803 104.07 108.474 111.51 117.8112 122.8152 132.7032 135.7392 142.13519 147.3672 151.77119 154.80721 157.8672 162.95399 168.42599 171.46201 181.27921 187.7592 190.7832 193.9752 199.59 205.98599 211.05 217.386"
         y="31.992001"
         id="tspan132">nok bryllupskager. For dem har jeg mulighed </tspan><tspan
         x="0 3.5051999 9.6731997 14.0772 17.113199 21.6492 24.8412 30.3132 34.056 37.248001 42.720001 45.756001 50.987999 54.695999 57.731998 64.031998 69.071999 74.715599 80.883598 85.144798 90.148804 94.408798 99.448799 102.4848 106.0248 109.0488 115.2528 118.9608 121.4832 124.5192 133.3884 138.8604 141.89639 148.1964 153.2724 156.98039 160.0164 165.0204 169.42439 172.4604 178.7616 183.9456 187.0056 190.0296 193.2216 198.6936 202.4016 204.92281 207.9588 214.5108 219.7428 224.1468"
         y="47.987999"
         id="tspan134">for rigtig at dekorere flot. Og det er dejligt, når </tspan><tspan
         x="0 5.8800001 12.36 18.912001 25.212 30.217199 34.702801 41.254799 46.2948 49.330799 55.487999 58.512001 61.586399 66.879601 71.884804 76.288803 79.324799 84.9636 87.987602 93.242401 99.543602 104.5836 107.6196 111.1248 117.2928 121.6968 124.7328 131.034 136.0392 142.5912 145.6272 151.5072 156.7392 162.18719 167.2272 169.7496 172.7856 177.04559 183.21359 193.10159 196.1376 202.4388 207.47881 210.5148 216.9108 222.14281 226.5468"
         y="63.984001"
         id="tspan136">kunderne bliver glade for den kage, som de har </tspan><tspan
         x="0 6.2147999 11.2548 15.5148 19.257601 22.4496 25.4736 29.181601 32.217602 35.9604 39.152401 42.176399 45.212399 51.513599 56.518799 60.778801 65.818802 70.078796 73.114799 77.374802 80.965202 87.134399 91.394402 96.434402 99.470398 105.8064 111.0384 116.6544 119.1768"
         y="79.980003"
         id="tspan138">bestilt til deres store dag. </tspan><tspan
         x="272.12399 280.71719 285.90121 288.89041 291.41281 294.44879 300.75 305.8248 309.53281 312.56879 318.0408 324.24481 328.6488 331.68481 334.74481 339.8316 345.30359 348.3396 351.87961 357.1116 362.99161 366.73441 369.92639 374.1864 380.06641 383.10239 386.2944 392.17441 397.84079 402.8808 405.4032 408.43921 417.33121 422.5632 426.96719 430.0032 436.1832 442.38721 446.8728 453.4248 458.4288 464.9808 470.02081 473.05679 478.12079 481.20361 484.2276 489.2316 493.63559"
         y="-0.024"
         id="tspan140">Nej, det gør jeg faktisk ikke. Når børnene eller </tspan><tspan
         x="272.12399 282.01199 285.20401 291.75601 294.79199 300.43439 306.60361 313.15561 318.19559 321.2316 327.62759 332.85959 337.26361 340.29959 343.8396 350.04361 356.37961 360.63959 365.70361 368.7276 372.98761 379.32361 384.5556 390.17041 392.69281 395.72879 398.75281 403.7832 409.07639 414.08041 418.48441 421.52039 424.58041 429.66721 435.13919 438.1752 442.43521 447.49921 450.40561 455.88959 459.4296 465.63361 468.65759 474.10559 479.16959 482.1936 485.38559 490.8576 493.89359 498.89761 505.44958"
         y="15.972"
         id="tspan142">min kone har fødselsdag, laver jeg selvfølgelig en </tspan><tspan
         x="272.12399 275.664 278.68799 284.892 288.60001 291.63599 297.86279 303.33481 306.37079 309.39481 317.2428 323.1228 328.78922 333.7944 338.19839 341.23441 347.11441 352.34641 357.7944 362.83441 365.87039 369.61319 372.80521 375.82919 378.8652 385.16641 390.17041 400.05841 402.58081 405.61679 415.50479 420.51001 427.06201 430.09799 433.84079 437.03281 440.05679 443.0928 449.19 454.48318 459.48721 463.74841 470.08441 475.31641 480.78839 483.8244 487.53241 492.7644 498.2124 503.21759 507.62161"
         y="31.968"
         id="tspan144">flot og lækker kage til dem, men til hverdag tager </tspan><tspan
         x="272.12399 275.18399 280.27081 285.7428 288.77881 298.66681 303.70679 307.9668 311.6748 314.71078 320.89081 326.1228 330.38281 335.42279 338.4588 344.604 349.008 355.21201 361.548 364.58401 370.81201 376.284 379.32001 385.20001 390.43201 395.88 400.88519 405.28922 408.3252 418.2132 423.276 429.612 432.64801 436.18799 440.68561 445.9176 448.95361 455.09879 461.54279 465.2868 468.47879 474.3588 480.02399 485.02921 491.58121 494.10361"
         y="47.964001"
         id="tspan146">jeg mest bare brød og kager med fra butikken. </tspan><tspan
         x="272.12399 278.09039 284.25839 288.66241 291.69839 295.9584 301.0224 303.9288 309.21121 315.37921 325.26721 328.30319 331.36319 336.45001 341.922 344.95801 350.022 353.04599 357.306 362.97119 367.97641 372.3804 375.41641 380.64841 384.35641 387.3924 393.57239 398.80441 404.25241 409.29239 411.81479 414.8508 420.7308 425.9628 432.5148 435.55081 438.61081 443.6976 449.16959 452.2056 457.43759 460.46161 464.16959 468.4296 473.66159 476.6976 482.9256 488.46719 492.7272 497.9592"
         y="63.959999"
         id="tspan148">For selvom jeg elsker at bage, kan jeg altså også </tspan><tspan
         x="272.12399 277.54919 283.78799 290.12399 293.832 296.86801 299.892 303.08401 309.38519 314.4252 317.46121 322.69321 326.40121 329.43719 335.83319 342.0372 345.06119 351.36121 356.40121 359.43719 362.9772 367.51321 370.7052 373.2276"
         y="79.956001"
         id="tspan150">godt lide at holde fri. </tspan></text>

       style="font-variant:normal;font-weight:normal;font-stretch:normal;font-size:12px;font-family:Minion;-inkscape-font-specification:Minion-Regular;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text182"><tspan
         x="0 3.7224 8.9544001 11.4768 14.5128 18.7728 23.8368 26.7432 32.2272 35.7672 41.971199 44.995201 50.443199 55.507198 58.5312 61.723202 67.337997 69.860397 72.8964 83.518799 86.7108 93.262802 99.598801 103.8588 107.5668 110.6028 115.6428 122.1948 125.2308 131.3988 141.2868 144.3228 150.6588 155.89079 161.33881 166.34399 172.896 175.4184 178.45441 182.12759 187.2144 192.6864 195.7224 200.72639 205.1304 208.1664 211.22639 217.4304"
         y="0"
         id="tspan158">Ja, selvfølgelig. Mindst én om dagen. Jeg er jo </tspan><tspan
         x="0 6.1799998 11.412 16.860001 21.8652 25.5984 28.1208 31.156799 37.383598 42.855598 45.891602 50.896801 57.448799 60.484798 66.664803 71.896797 77.344803 82.349998 86.753998 89.790001 94.050003 99.93 105.162 108.186 111.222 115.482 125.37 130.60201 136.05119 141.0912 144.1272 150.4632 155.69521 158.7312 165.0312 170.0712 173.10719 178.6032 183.83521 188.0952 193.1004 196.8336 199.356 202.392 208.78799 214.02 220.57201"
         y="15.996"
         id="tspan160">bager, og en bager skal smage på de varer, han </tspan><tspan
         x="0 4.2600002 12.108 15.132 20.58 25.585199 29.989201 33.0252 36.217201 39.253201 43.513199 46.7052 53.257198 56.293201 62.437199 68.882401 72.625198 75.8172 81.697197 84.219597 87.2556 91.515602 96.879601 103.4316 108.4716 112.7316 115.7676 118.8276 123.9144 129.52921 132.05161 135.0876 143.95799 149.42999 152.466 155.526 160.61279 166.08479 169.1208 174.18359 177.2076 181.46761 187.134 192.138 196.54201 199.578 205.758 210.99001 215.25 220.28999"
         y="31.992001"
         id="tspan162">sælger i sin butik, synes jeg. Og jeg elsker bare </tspan><tspan
         x="0 4.2600002 10.464 16.7652 21.805201 24.8412 29.1012 34.333199 39.7812 44.7864 49.190399 52.4184 55.454399 64.214401 69.2892 72.9972 76.033203 81.9132 87.145203 93.697197 96.7332 106.6212 111.8532 118.4052 121.4412 127.668 133.2108 137.47079 142.7028 145.7388 151.1628 157.4028 163.7388 167.44679 170.4828 174.7428 179.78281 182.8188 189.1548 194.3868 197.42281 207.31081 210.50281 216.1176 218.64"
         y="47.987999"
         id="tspan164">søde sager! Det kan man også godt se på mig, </tspan><tspan
         x="0 3.0599999 8.1468 13.6188 16.6548 23.0508 28.282801 32.686798 35.722801 40.726799 47.278801 50.3148 54.574799 58.165199 64.334396 68.738403 71.774399 81.662399 86.691597 91.984802 97.024803 100.2528 103.2888 113.9112 117.1032 123.6552 126.6912 132.3336 138.50281 145.05479 150.0948 153.1308 159.52679 164.7588 169.1628 172.19881 175.9416 179.13361 182.8416 185.87759 190.1376 195.3696 200.8416 204.54961 207.0708 210.1068 215.33881 219.0468"
         y="63.984001"
         id="tspan166">jeg har en stor mave! Min kone har tit sagt, at </tspan><tspan
         x="0 3.0599999 8.1468 13.6188 16.6548 20.914801 26.7948 32.026798 35.0508 38.0868 41.7948 47.026798 53.2416 58.281601 61.3176 71.205597 74.397598 80.012398 82.534798 85.570801 95.458801 100.464 107.016 110.052 116.352 121.428 125.136 128.172 133.17599 137.58 140.616 145.84801 148.87199 152.58 156.84 162.07201 165.108 168.3 174.17999 179.8452 184.88519 187.9212 192.1812 197.41319 200.4492 203.47321 208.54919 212.2572 214.7784 217.81441 224.36639 229.5984 234.0024"
         y="79.980003"
         id="tspan168">jeg skal tabe mig, men det er altså ikke så let, når </tspan><tspan
         x="0 9.8879995 15.12 21.672001 24.708 29.712 34.116001 37.152 43.332001 48.563999 54.013199 59.0172 62.750401"
         y="95.975998"
         id="tspan170">man er bager.</tspan><tspan
         x="272.12399 275.84641 281.0784 283.6008 286.63681 292.93799 297.94199 307.82999 310.866 315.87119 320.27521 323.31119 326.37119 331.45801 336.92999 339.966 343.15799 349.03799 354.70319 359.74319 362.77921 367.03922 372.27121 375.30719 380.94601 383.97 389.22601 395.56201 398.59799 402.10199 408.27121 412.00439 414.52679 417.56281 428.27881 433.5108 437.77081 443.436 448.47601 451.51199 455.01721 461.1864 465.44641 471.78241 474.9744 478.01041 481.0704 486.1572 491.62921"
         y="-0.024"
         id="tspan172">Ja, dem er jeg ikke så glad for. Måske fordi jeg </tspan><tspan
         x="272.12399 275.31601 281.19601 286.8624 291.9024 294.93839 299.94241 304.34641 307.38239 311.6424 319.49039 323.94119 326.96521 330.1572 335.62921 338.66519 344.09039 350.32919 356.66519 359.7012 363.444 366.63599 369.66 372.69601 376.40399 381.63599 384.66 387.1824 390.21841 400.59961 405.6048 412.1568 415.19281 421.49399 426.56879 430.27679 433.31281 438.31799 442.72198 445.758 455.646 458.83801 465.39001 468.42599 474.06961 480.23761 486.78961 491.82959"
         y="15.972"
         id="tspan174">ikke er særlig god til tal. Men det er min kone </tspan><tspan
         x="272.12399 278.51999 283.58279 286.60681 292.94281 296.1348 301.60681 307.26959 310.46161 314.72159 317.94958 320.9856 326.6976 331.9296 334.96561 341.2908 347.77081 354.32281 357.3588 363.52802 367.78799 374.12399 380.67599 385.67999 390.08401 393.12 398.35199 401.37601 405.1188 408.31079 414.64679 417.6828 422.91479 425.99759 429.02161 434.06161 437.0976 441.3576 446.4444 452.0484 458.6004 462.86041 468.74039 473.97241 480.18719 485.19241 489.67801 496.23001 501.26999"
         y="31.968"
         id="tspan176">heldigvis! Så hun ordner altid alle regnskaberne </tspan><tspan
         x="272.12399 275.62921 281.79721 286.2012 289.23721 299.12521 302.3172 307.9332 310.4556 313.49161 322.2504 327.32639 331.03439 334.0704 339.0744 343.47839 346.5144 351.93961 358.17841 364.5144 368.22241 370.74481 373.78079 377.28601 383.4552 387.85919 390.8952 395.15521 400.38721 403.42319 409.30319 414.53519 421.08719 424.1232 427.1832 432.26999 437.742 440.77802 446.42041 452.5896 459.1416 464.01361 469.0188 475.5708 479.34839 483.6084 488.61359 492.8736 497.9136"
         y="47.964001"
         id="tspan178">for mig. Det er godt, for så kan jeg koncentrere </tspan><tspan
         x="272.12399 282.01199 285.20401 290.67599 293.71201 299.88 309.76801 312.80399 318.03601 321.74399 324.78 330.95999 336.19199 341.6412 346.68121 349.71719 356.2692 362.496 368.1348 371.15881 376.19879 379.2348 384.66 390.8988 397.20001 402.23999 405.276 411.4212 415.8252 422.02921 428.3652 431.40121 437.62799 443.10001 446.13599 452.01599 457.24799 462.69601 467.7012 471.43439 473.95679"
         y="63.959999"
         id="tspan180">mig om at bage nogle gode brød og kager. </tspan></text>

         id="tspan190">selvfølgelig op midt om natten, men så er jeg </tspan><tspan
